import React from 'react';
import './Auth.css';

const Login = () => {



  return (
    <div className="Login">
      <h1>Login</h1>
      <div className="Login">
      <form>
        <input type="text" placeholder="Username" />
        <input type="password" placeholder="Password" />
        <button type="submit">Login</button>
      </form>
      </div>
    </div>
  );
}
export default Login;
